//Categories view
export class CategoryDisplay {
	constructor(private _id : number, private _containerImage : string, private _name : string) {}
	get id(): number {
		return this._id;
	}
	get name(): string {
		return this._name;
	}
	get image(): string {
		return 'data:image/jpeg;base64,';
	}
}

